import React from "react";

function Footer() {
    return (
        <div className="footer">
            <div className="col-xs-3">
                <h3>About us</h3>
            </div>
            <div className="col-xs-3">
                <h3> Policy&Service</h3>
            </div>
            <div className="col-xs-3">
                <h3> User Agreement</h3>
            </div>
            <div className="col-xs-3">
                <h3> Terms&Conditions</h3>
            </div>
        </div>
    );
}

export default Footer;
